import React from 'react';
import '../App.css';
import {Link} from 'react-router-dom';

import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';

class NavBar extends React.Component {
  navliststyle = {
    color: 'black',
  }
  render(){
  return (
    <div >
    <nav className='navbar'>
      <Link to="/">
      <img className='logo' src='https://cdn.iconscout.com/icon/free/png-256/food-809-675214.png' alt='logofood'/>
      </Link>
      <ul className='nav-links'>
        {this.props.navitems.map(navitem => 
        <Link key={navitem.linkname} style={this.navliststyle} to={navitem.linkto}><li>{navitem.linkname}</li></Link>
          )}
        <div className="shoppingcart" style={{position: "relative", borderLeft: "2px solid black" ,backgroundColor:"darkorange" ,width:"150px" ,top: "-8px"}}>
          <ShoppingCartIcon style={{position: "relative", top: "0px",float: "left" ,fontSize: "40px"}}/>
          <h2 style={{top: "0px"}}>ShoppingCart</h2>
        </div>
      </ul>
    </nav>
    </div>
  );
  }
}

export default NavBar;
